import{_ as a}from"./chunks/index.VAya1KE4.js";import{c,o as e,G as o,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":179,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":179,"name":"可琳","summary":"可琳·威克斯","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/28/110289248/90abac5b57bd5b48fa79e9efb5254360_7680652488792868823.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/22d3fe799d503c3cfb059d7ca7c88918_8753582124469429797.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/25/76099754/407e55256a9482ff329b8ae083624e68_2977543372525146934.png"},"attrs":[["稀有度","A"],["属性","物理"],["特性","强攻"],["阵营","维多利亚家政"]],"destiny":[["LEVEL1开放性创伤","[连携技]或[终结技]命中敌人时，可琳对目标造成的伤害提升12%，持续15秒。「大小姐说，做事情的时候一定要专注，不能被周围影响。」「可琳练习了很久，终于可以做到了！」「可是…你看到了吗，大小姐…」"],["LEVEL2裂解效应","[强化特殊技]、[连携技]或[终结技]命中敌人时，目标的物理伤害抗性下降0.5%，最多叠加20层，持续5秒，每层效果单独结算持续时间。「对不起，以骸先生或者以骸女士！」「但是可琳需要完成自己的任务…真的很抱歉！」少女真诚而愧疚地对着面前的怪物道歉——一边挥动着手上的电锯，将面前的敌人们尽数消灭。"],["LEVEL3初级女仆","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2「为、为了成为能独当一面的女仆，可琳会加油努力的！」——可琳手持锯子，一边走向以骸一边说道"],["LEVEL4战场随侍","发动[快速支援]、[招架支援]或[连携技]时，可琳回复7.2点能量，16秒内最多触发一次。勤恳认真的女仆小姐，对待任何事情都是一心一意的。当然，也包括在战场上面对敌人的时候。"],["LEVEL5特勤女仆","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2「唔…对、对不起，可琳笨手笨脚的，没办法把东西切得很均匀…」——看着脚下遍布的以骸残块，可琳沮丧地说道"],["LEVEL6厚积薄发","持续斩击命中敌人时，可琳获得1层充能(最多40层)；在[闪避反击]、[特殊技]、[强化特殊技]、[快速支援]、[支援突击]中，引爆电锯命中敌人时，消耗所有充能，每层充能使本次攻击额外造成可琳3%攻击力的伤害。可琳知道，自己并不是最厉害的女仆，也不是最聪明的女仆。但她希望能成为最努力的女仆。过去积累的每一份努力，都有存在的意义。"]],"skill":[{"title":"普通攻击：扫除开始","desc":"点按发动：向前方进行至多五段的斩击，造成物理伤害；在第三、五段中连点或长按时，可以使用电锯持续斩击敌人。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/06/82232455/150afba2349562f2761b5761c86e5e6e_8412520648494564069.gif"},{"title":"闪避：[离]","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/141353238/4b553a03bffc54cd0df3852247dee652_8417318108529464169.gif"},{"title":"冲刺攻击：[断]","desc":"闪避时，点按发动：向前方发动斩击，造成物理伤害；连点或长按时，可以使用电锯持续斩击敌人。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/141353238/31e85d87fe9fd28bc3426cbaa382aaab_3664311206682750449.gif"},{"title":"闪避反击：[舍]","desc":"触发[极限闪避]后，点按发动：对前方敌人发动斩击，随后引爆电锯，造成物理伤害；连点或长按时，可以使用电锯持续斩击敌人；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/141353238/4556994ed325da807b407fdfb95e891f_5767689990957766914.gif"},{"title":"快速支援：应急措施","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动斩击，随后引爆电锯，造成物理伤害；连点或长按时，可以使用电锯持续斩击敌人；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/62fb66085544a4cc47ba46fa8b316fbd_5468534794200320717.gif"},{"title":"招架支援：请、请让我来！","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；具有较为优秀的招架性能，承受高强度攻击时[支援点数]的消耗量降低；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/b876d904bba0825831ab0bedaa55da3f_5780355620528022156.gif"},{"title":"支援突击：快速清扫","desc":"发动[招架支援]后，点按发动：对前方敌人发动连续斩击，随后引爆电锯，造成物理伤害；连点或长按时，可以使用电锯持续斩击敌人；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/b8379bf5b108bacaaec222edb0f8d52f_7167049308579677620.gif"},{"title":"特殊技：强力清扫","desc":"点按发动：向前方进行持续斩击，随后引爆电锯，造成物理伤害；连点或长按时，可以使用电锯持续斩击敌人；招式发动期间抗打断等级提升，受到的伤害降低40%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/468cf8967cfd5513e413d04e42ed59de_2837527645389452654.gif"},{"title":"强化特殊技：小心裙角","desc":"能量足够时，点按发动：向前方进行持续强力斩击，随后引爆电锯，造成大量物理伤害；连点或长按时，可以使用电锯持续斩击敌人，并随招式命中目标，逐渐消耗能量；回旋斩击期间拥有无敌效果；持续斩击期间抗打断等级提升，受到的伤害降低40%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/6051c5a2e294853c3cb714f2757bc42b_2138015642571823567.gif"},{"title":"连携技：抱歉...","desc":"触发[连携技]时，选择对应角色发动：对前方小范围敌人发动强力斩击，造成大量物理伤害；连点或长按时，可以使用电锯持续斩击敌人；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/78e7e040866cdabdb9a58c6ef4de432a_2835879147900548724.gif"},{"title":"终结技：非、非常抱歉！","desc":"喧响等级达到[极]时，点按发动：对前方小范围敌人发动强力斩击，造成大量物理伤害；连点或长按时，可以使用电锯持续斩击敌人；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/141353238/b95cff5077dccfdccf70ebdd829304b8_8451677910633115297.gif"},{"title":"核心技","desc":"核心被动：专注连点或长按后，可琳使用电锯持续斩击敌人时，招式造成的伤害提升18.7%。（此处数据为原始数据）额外能力：扫除帮手队伍中存在与自身属性或阵营相同的角色时触发:可琳攻击命中处于失衡状态下的敌人时，自身造成的伤害提升35%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/01/294465423/f1061da09e9cdbe0d0c5ca9b6b44d2a7_8203824872816057079.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/179.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/179.md"},_=Object.assign(d,{setup(i){return(p,n)=>(e(),c("div",null,[o(t(a))]))}});export{l as __pageData,_ as default};
